// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";

// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";

// Data
// import authorsTableData from "layouts/drone/data/authorsTableData";
// import projectsTableData from "layouts/drone/data/projectsTableData";
import { Link } from "@mui/material";
import { NavLink } from "react-router-dom";

function Drone() {
  // const { columns, rows } = authorsTableData();
  // const { columns: pColumns, rows: pRows } = projectsTableData();

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox py={12}>
        {/* 카드간 간격 */}
        <Grid container spacing={23}>
          {/* 1. 카드 */}
          <Grid item xs={12} md={6} lg={6}>
            <MDBox
              bgColor="#343a40"
              component={NavLink}
              to="/"
              mb={1.5}
              borderRadius="lg"
              opacity={1}
            >
              <MDTypography variant="body2" fontWeight="regular" color="white" fontSize="100px">
                G P S
              </MDTypography>
            </MDBox>
          </Grid>

          {/* 2. 카드 */}
          <Grid item xs={12} md={6} lg={6}>
            <MDBox mb={1.5} bgColor="#343a40" borderRadius="lg" opacity={1}>
              <Link href="https://www.creative-tim.com/" target="_blank">
                <MDTypography variant="body2" fontWeight="regular" color="white" fontSize="100px">
                  환 경 정 보
                </MDTypography>
              </Link>
            </MDBox>
          </Grid>

          {/* 3. 카드 */}
          <Grid item xs={12} md={6} lg={6}>
            <MDBox mb={1.5} bgColor="#343a40" borderRadius="lg" opacity={1}>
              <Link href="https://www.creative-tim.com/" target="_blank">
                <MDTypography variant="body2" fontWeight="regular" color="white" fontSize="100px">
                  촬 영 정 보
                </MDTypography>
              </Link>
            </MDBox>
          </Grid>

          {/* 4. 카드 */}
          <Grid item xs={12} md={6} lg={6}>
            <MDBox mb={1.5} bgColor="#343a40" borderRadius="lg" opacity={1}>
              <Link href="https://www.creative-tim.com/" target="_blank">
                <MDTypography variant="body2" fontWeight="regular" color="white" fontSize="100px">
                  강 제 제 어
                </MDTypography>
              </Link>
            </MDBox>
          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Drone;
